import { useState, useEffect } from "react";

export const Test = () => {
  const [test, setTest] = useState("initial");

  useEffect(() => {
    try {
      const request = fetch("/api")
        
      request.then((res) => {
          console.log(res.json())
        });
      console.log(test)
    } catch (error) {
      console.log("error =>", error);
    }
  }, []);

  return <h1>{test}</h1>;
};
